// Next.js API route support: https://nextjs.org/docs/api-routes/introduction

export default (async(req, res) => {
  const resHtml = await fetch('http://localhost:3000/posts')
  console.log("resHtml========>", resHtml);
  res.statusCode = 200
  res.json({ name: 'John Doe' })
})();
